Titanic - The Entire Story

History Documentary hosted by Martin Sheen, published by Discovery Channel in 2008 - English narration


Information
------------------------------

Titanic: The Entire Story 
This is an excellent documentary and investigation into RMS Titanic, presented across eight discs each in their own slimline box, in this order as follows


1)  The Investigation Begins 
This programme documents an unprecedented August 1996 research and recovery expedition, during which a section of the Titanic's hull is raised, briefly, before returning to the ocean floor. Approximately 52 minutes long and narrated by Nat Benchley.


